import React from "react";

import {
    CssClasses,
    getColorType
} 
from "../../../utilities"

const row = props => {
    const classes = new CssClasses("row");

    const color = getColorType(props, "bg");

    classes.addClass(color);

    return (
        <div className={classes.toString()}>
            {props.children}
        </div>
    )
};

export default row;
